package org.example.entity;import org.example.entity.abstractClass.abstractInfo;import java.sql.Timestamp;import java.util.Scanner;public class Locator extends abstractInfo {    private Integer x;    private Integer y;    private Integer z;    private Integer warehouseId;    public Locator(){}    public Locator(int id, String name, Boolean isActive, String createdBy, Timestamp created, Integer x, Integer y,                   Integer z, int warehouseId) {        super(id, name, isActive, createdBy, created);        this.x = x;        this.y = y;        this.z = z;        this.warehouseId = warehouseId;    }    public Integer getX() {        return x;    }    public void setX(Integer x) {        this.x = x;    }    public Integer getY() {        return y;    }    public void setY(Integer y) {        this.y = y;    }    public Integer getZ() {        return z;    }    public void setZ(Integer z) {        this.z = z;    }    public Integer getWarehouseId() {        return warehouseId;    }    public void setWarehouseId(Integer warehouseId) {        this.warehouseId = warehouseId;    }    public void input(Scanner sc) {        super.input(sc);        System.out.print("Nh廕計 x: ");        this.x = sc.nextInt();        System.out.print("Nh廕計 y: ");        this.y = sc.nextInt();        System.out.print("Nh廕計 z: ");        this.z = sc.nextInt();        System.out.print("Nh廕計 warehouseId: ");        this.warehouseId = sc.nextInt();    }}